/draw_dot
{
    currentpoint .1 0 360 arc
    closepath fill
} bind def

/draw_dw10_dot
{
    currentpoint .05 0 360 arc
    closepath fill
} bind def

/filledcircle {
  gsave
    setcmykcolor 4 1 roll translate rotate 0 0 3 -1 roll 0 360 arc
    closepath fill
  grestore
} bind def

