/aero_end {
    grestore
} bind def

/aero_outer {
  .4 setlinewidth 0 0 2.3 0 360 arc stroke
} bind def

/aero_dashed {
  .4 setlinewidth 0 0 2.3 -34.5 34.5 arc stroke
  0 0 2.3 55.5 124.5 arc stroke
  0 0 2.3 145.5 214.5 arc stroke
  0 0 2.3 235.5 304.5 arc stroke
} bind def

/aero_inner {
  .15 setlinewidth 0 0 1.85 0 360 arc stroke
} bind def

/point713 { % Aerodrome - licensed civilian without passenger facilities
    aero_start aero_outer aero_end
} bind def

/point716 { % Aerodrome - licensed joint civilian and military
